import { useState } from 'react';
import { useAuth } from '../../context/AuthContext';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { generateKeyPair, exportPublicKey, exportPrivateKey } from '../../utils/crypto';

export default function SignUp() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [name, setName] = useState('');
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);
    const { signUp } = useAuth();
    const navigate = useNavigate();
    const location = useLocation();

    const from = location.state?.from?.pathname || '/dashboard';

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();
        setError('');
        setLoading(true);

        try {
            // 1. Генерация ключевой пары
            const keyPair = await generateKeyPair();

            // 2. Экспорт публичного ключа для сервера
            const publicKey = await exportPublicKey(keyPair.publicKey);

            // 3. Экспорт приватного ключа в PEM для скачивания
            const privateKeyPem = await exportPrivateKey(keyPair.privateKey);

            // 4. Отправка данных на сервер
            const { success, error } = await signUp(email, password, name, publicKey);

            if (success) {
                // 5. Скачивание приватного ключа
                downloadPrivateKey(privateKeyPem, email);

                // 6. Перенаправление
                navigate(from, { replace: true });
            } else {
                setError(error || 'Failed to sign up');
            }
        } catch (err) {
            setError('An unexpected error occurred');
            console.error('Registration error:', err);
        } finally {
            setLoading(false);
        }
    };

    const downloadPrivateKey = (keyData: string, email: string) => {
        const blob = new Blob([keyData], { type: 'application/x-pem-file' });
        const url = URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = `filecrypt_${email}_private_key.pem`;
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(url);
    };

    return (
        <div className="auth-container">
            <div className="auth-card">
                <h1 className="auth-title">Create Account</h1>

                {error && <div className="error-message">{error}</div>}

                <div className="mb-4 p-4 bg-blue-50 rounded-lg text-sm">
                    <p className="font-medium">Important:</p>
                    <p>After registration, your private key will be downloaded automatically.</p>
                    <p>Save it securely - it cannot be recovered!</p>
                </div>

                <form className="auth-form" onSubmit={handleSubmit}>
                    <div className="form-group">
                        <label htmlFor="name">Full Name</label>
                        <input
                            id="name"
                            type="text"
                            value={name}
                            onChange={(e) => setName(e.target.value)}
                            required
                            placeholder="Enter your full name"
                            className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                        />
                    </div>

                    <div className="form-group mt-4">
                        <label htmlFor="email">Email Address</label>
                        <input
                            id="email"
                            type="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                            placeholder="your@email.com"
                            className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                        />
                    </div>
                    <div className="form-group mt-4">
                        <label htmlFor="password">Password</label>
                        <input
                            id="password"
                            type="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                            minLength={8}
                            placeholder="At least 8 characters"
                            className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                        />
                        <p className="text-xs text-gray-500 mt-1">
                            Use a strong password with mix of letters, numbers and symbols
                        </p>
                    </div>
                    <button
                        type="submit"
                        className="btn btn-primary"
                        disabled={loading}
                    >
                        {loading ? 'Creating Account...' : 'Sign Up'}
                    </button>
                </form>

                <div className="auth-footer">
                    Already have an account?{' '}
                    <Link to="/signin" className="link" state={{ from }}>
                        Sign In
                    </Link>
                </div>
            </div>
        </div>
    );
}
